// src/components/ServiceIcons.js
import React from 'react';
import { FiDroplet, FiLayers, FiSettings } from 'react-icons/fi'; // Feather icons
import '../styles/services.css';

const services = [
  {
    id: 1,
    Icon: FiDroplet,
    title: "Pool Design",
    description: "Custom designs tailored to your space"
  },
  {
    id: 2,
    Icon: FiLayers,
    title: "Installation",
    description: "Professional setup with premium materials"
  },
  {
    id: 3,
    Icon: FiSettings,
    title: "Maintenance",
    description: "Regular cleaning and system checks"
  }
];

const ServiceIcons = () => {
  return (
    <div className="services-grid">
      {services.map(({ id, Icon, title, description }) => (
        <div key={id} className="service-card">
          <div className="icon-wrapper">
            <Icon className="service-icon" />
          </div>
          <h3>{title}</h3>
          <p>{description}</p>
        </div>
      ))}
    </div>
  );
};

export default ServiceIcons;
